async function fillAddrees(e){const a=await fetch(BASE_URL+"/get_address/"+e),t=await a.json();ONE_ELEMENT("input[name=street]").value=t.address.logradouro,ONE_ELEMENT("input[name=neighboorhood]").value=t.address.bairro,ONE_ELEMENT("input[name=state]").value=t.address.localidade}ONE_ELEMENT("#cepInput").addEventListener("focusout",e=>{fillAddrees(e.currentTarget.value)});